import './section3.css';
import Img1 from './phone1.png';
const section3 = () => {
    return ( 
        <div className="section3">
            <div className="outterdiv"></div>
            <img src={Img1} alt="" />
            <img src="./phone2.png" alt="" />
        </div>
     );
}

export default section3;
